-- Procedure structure for Compute for PartsCostTotal (MOD)
-- ----------------------------
DROP PROCEDURE IF EXISTS `Compute for PartsCostTotal (MOD)`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `Compute for PartsCostTotal (MOD)`()
BEGIN

	/* 
	NOTE: 
	OLDER VERSION as of 4/19/2016
	This is taking the divisible intervals totals 
	*/

	DECLARE iCount DOUBLE DEFAULT 0;
	DECLARE v_id INT;
	DECLARE v_model_tier_id INT;
	DECLARE v_serviceInterval VARCHAR(11);
	DECLARE v_laborHoursTotal DECIMAL(6,2);
	DECLARE v_partsCostTotal_USD DECIMAL(11,2);
	DECLARE v_partsCostTotal_CAN DECIMAL(11,2);
	DECLARE v_laborHoursTotal_ProCare DECIMAL(6,2);
	DECLARE v_partsCostTotal_ProCare_USD DECIMAL(11,2);
	DECLARE v_partsCostTotal_ProCare_CAN DECIMAL(11,2);
	DECLARE exit_loop1 BOOLEAN;
	-- Declare the cursor
	DECLARE processed_cursor1 CURSOR FOR 
		SELECT DISTINCT id, model_tier_id, serviceInterval FROM sqthours_costs
		ORDER BY model_tier_id ASC, serviceIntervalHours ASC;
	-- set exit_loop flag to true if there are no more rows
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET exit_loop1 = TRUE;
	-- Reset Totals to 0
	UPDATE sqthours_costs
	SET laborHoursTotal = 0, 
			laborHoursTotal_ProCare = 0, 
			partsCostTotal_USD = 0, 
			partsCostTotal_CAN = 0,
			partsCostTotal_ProCare_USD = 0, 
			partsCostTotal_ProCare_CAN = 0;
	-- open the cursor
	OPEN processed_cursor1;
	-- start looping
	processed_loop1: LOOP
		-- read the name from next row into the variables
		FETCH  processed_cursor1 INTO v_id, v_model_tier_id, v_serviceInterval;
		-- check if the exit_loop flag has been set by mysql,
		IF exit_loop1 THEN
			LEAVE processed_loop1;
		END IF;
		-- check if initial or repeatable
		IF LEFT(UPPER(v_serviceInterval),1) = 'I' THEN -- if Initial
			UPDATE sqthours_costs
			SET laborHoursTotal = laborHours,
					laborHoursTotal_ProCare = laborHours,
					partsCostTotal_USD = partsCost_USD, 
					partsCostTotal_CAN = partsCost_CAN,
					partsCostTotal_ProCare_USD = partsCost_USD, 
					partsCostTotal_ProCare_CAN = partsCost_CAN
			WHERE id = v_id;
		ELSE -- if Repeatable 
			SELECT SUM(laborHours), SUM(x.partsCost_USD), SUM(x.partsCost_CAN)
			INTO v_laborHoursTotal, v_partsCostTotal_USD, v_partsCostTotal_CAN
			FROM(SELECT laborHours, partsCost_USD, partsCost_CAN, MOD(CAST(SUBSTRING(v_serviceInterval,2, LENGTH(v_serviceInterval)) AS UNSIGNED), CAST(SUBSTRING(serviceInterval,2, LENGTH(serviceInterval)) AS UNSIGNED)) = 0 AS ISDIV
				FROM sqthours_costs
				WHERE model_tier_id = v_model_tier_id) x 
			WHERE x.ISDIV;
			IF CAST(SUBSTRING(v_serviceInterval,2, LENGTH(v_serviceInterval)) AS UNSIGNED) > 3000 THEN  -- if over ProCare Coverage limit
				/*
				SELECT serviceInterval
				INTO v_serviceInterval
				FROM sqthours_costs 
				WHERE model_tier_id = v_model_tier_id
					AND CAST(SUBSTRING(serviceInterval,2, LENGTH(serviceInterval)) AS UNSIGNED) <= 3000
				ORDER BY serviceInterval DESC
				LIMIT 1;
				*/
				SELECT SUM(laborHours), SUM(x.partsCost_USD), SUM(x.partsCost_CAN)
				INTO v_laborHoursTotal_ProCare, v_partsCostTotal_ProCare_USD, v_partsCostTotal_ProCare_CAN
				FROM (SELECT serviceInterval, laborHours, partsCost_USD, partsCost_CAN, MOD(CAST(SUBSTRING(v_serviceInterval,2, LENGTH(v_serviceInterval)) AS UNSIGNED), CAST(SUBSTRING(serviceInterval,2, LENGTH(serviceInterval)) AS UNSIGNED)) = 0 AS ISDIV
					FROM sqthours_costs
					WHERE model_tier_id = v_model_tier_id) x
				WHERE x.ISDIV AND CAST(SUBSTRING(x.serviceInterval,2, LENGTH(x.serviceInterval)) AS UNSIGNED) <= 3000;
			ELSE	
				SET v_laborHoursTotal_ProCare = v_laborHoursTotal;
				SET v_partsCostTotal_ProCare_USD = v_partsCostTotal_USD;
				SET v_partsCostTotal_ProCare_CAN = v_partsCostTotal_CAN;
			END IF;
			UPDATE sqthours_costs
			SET laborHoursTotal = v_laborHoursTotal, 
					laborHoursTotal_ProCare = v_laborHoursTotal_ProCare, 
					partsCostTotal_USD = v_partsCostTotal_USD, 
					partsCostTotal_CAN = v_partsCostTotal_CAN,
					partsCostTotal_ProCare_USD = v_partsCostTotal_ProCare_USD, 
					partsCostTotal_ProCare_CAN = v_partsCostTotal_ProCare_CAN
			WHERE id = v_id;
		END IF;
	SET iCount = iCount + 1;
	END LOOP processed_loop1;
	CLOSE processed_cursor1;
	SELECT iCount;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for Compute for PartsCostTotal (Non-MOD)
-- ----------------------------
DROP PROCEDURE IF EXISTS `Compute for PartsCostTotal (Non-MOD)`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `Compute for PartsCostTotal (Non-MOD)`()
BEGIN
	/* 
	NOTE: 
	OLDER VERSION as of 4/19/2016
	This is NOT taking the divisible intervals totals. But totals all prior interval regardless of divisibility. 
	*/
	DECLARE iCount DOUBLE DEFAULT 0;
	DECLARE v_id INT;
	DECLARE v_product VARCHAR(255);
	DECLARE v_model VARCHAR(255);
	DECLARE v_model_tier_id INT;
	DECLARE v_serviceInterval VARCHAR(11);
	DECLARE v_laborHoursTotal DECIMAL(6,2);
	DECLARE v_partsCostTotal_USD DECIMAL(11,2);
	DECLARE v_partsCostTotal_CAN DECIMAL(11,2);
	DECLARE v_laborHoursTotal_ProCare DECIMAL(6,2);
	DECLARE v_partsCostTotal_ProCare_USD DECIMAL(11,2);
	DECLARE v_partsCostTotal_ProCare_CAN DECIMAL(11,2);
	DECLARE exit_loop1 BOOLEAN;
	-- Declare the cursor
	DECLARE processed_cursor1 CURSOR FOR 
		SELECT id, product, model, model_tier_id, serviceInterval FROM sqthours_costs
		ORDER BY model_tier_id ASC, serviceIntervalHours ASC;
	-- set exit_loop flag to true if there are no more rows
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET exit_loop1 = TRUE;
	-- Reset Totals to 0
	UPDATE sqthours_costs
	SET laborHoursTotal = 0, 
			laborHoursTotal_ProCare = 0, 
			partsCostTotal_USD = 0, 
			partsCostTotal_CAN = 0,
			partsCostTotal_ProCare_USD = 0, 
			partsCostTotal_ProCare_CAN = 0;
	-- open the cursor
	OPEN processed_cursor1;
	-- start looping
	processed_loop1: LOOP
		-- read the name from next row into the variables
		FETCH  processed_cursor1 INTO v_id, v_product, v_model, v_model_tier_id, v_serviceInterval;
		-- check if the exit_loop flag has been set by mysql,
		IF exit_loop1 THEN
			LEAVE processed_loop1;
		END IF;

		SELECT SUM(laborHours), SUM(partsCost_USD), SUM(partsCost_CAN)
		INTO v_laborHoursTotal, v_partsCostTotal_USD, v_partsCostTotal_CAN
		FROM sqthours_costs
		WHERE (model_tier_id = v_model_tier_id OR model_tier_id IS NULL) AND product = v_product AND model = v_model
					AND CAST(SUBSTRING(serviceInterval,2, LENGTH(serviceInterval)) AS UNSIGNED) <= CAST(SUBSTRING(v_serviceInterval,2, LENGTH(v_serviceInterval)) AS UNSIGNED);

		IF CAST(SUBSTRING(v_serviceInterval,2, LENGTH(v_serviceInterval)) AS UNSIGNED) > 3000 THEN  -- if over ProCare Coverage limit
			SELECT SUM(laborHours), SUM(partsCost_USD), SUM(partsCost_CAN)
			INTO v_laborHoursTotal_ProCare, v_partsCostTotal_ProCare_USD, v_partsCostTotal_ProCare_CAN
			FROM sqthours_costs
			WHERE (model_tier_id = v_model_tier_id OR model_tier_id IS NULL) AND product = v_product AND model = v_model
						AND CAST(SUBSTRING(serviceInterval,2, LENGTH(serviceInterval)) AS UNSIGNED) <= 3000;

		ELSE	
			SET v_laborHoursTotal_ProCare = v_laborHoursTotal;
			SET v_partsCostTotal_ProCare_USD = v_partsCostTotal_USD;
			SET v_partsCostTotal_ProCare_CAN = v_partsCostTotal_CAN;

		END IF;

		UPDATE sqthours_costs
		SET laborHoursTotal = v_laborHoursTotal, 
				laborHoursTotal_ProCare = v_laborHoursTotal_ProCare, 
				partsCostTotal_USD = v_partsCostTotal_USD, 
				partsCostTotal_CAN = v_partsCostTotal_CAN,
				partsCostTotal_ProCare_USD = v_partsCostTotal_ProCare_USD, 
				partsCostTotal_ProCare_CAN = v_partsCostTotal_ProCare_CAN
		WHERE id = v_id;

	SET iCount = iCount + 1;
	END LOOP processed_loop1;
	CLOSE processed_cursor1;
	SELECT iCount;
END
;;
DELIMITER ;
